import 'package:equatable/equatable.dart';
import '../models/alarm.dart';

abstract class AlarmEvent extends Equatable {
  const AlarmEvent();

  @override
  List<Object?> get props => [];
}

class LoadAlarms extends AlarmEvent {
  final String userId;
  const LoadAlarms(this.userId);

  @override
  List<Object?> get props => [userId];
}

class AddAlarm extends AlarmEvent {
  final Alarm alarm;
  final String userId;
  const AddAlarm(this.alarm, this.userId);

  @override
  List<Object?> get props => [alarm, userId];
}

class AddSafetyAlarm extends AlarmEvent {
  final String id;
  final String message;
  final AlarmSeverity severity;
  final String userId;

  const AddSafetyAlarm({
    required this.id,
    required this.message,
    required this.severity,
    required this.userId,
  });

  @override
  List<Object?> get props => [id, message, severity, userId];
}

class AcknowledgeAlarm extends AlarmEvent {
  final String alarmId;
  final String userId;
  const AcknowledgeAlarm(this.alarmId, this.userId);

  @override
  List<Object?> get props => [alarmId, userId];
}

class ClearAlarm extends AlarmEvent {
  final String alarmId;
  final String userId;
  const ClearAlarm(this.alarmId, this.userId);

  @override
  List<Object?> get props => [alarmId, userId];
}

class ClearAcknowledgedAlarms extends AlarmEvent {
  final String userId;
  const ClearAcknowledgedAlarms(this.userId);

  @override
  List<Object?> get props => [userId];
}
